import React from "react";
import "./Contact.css";
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import MailIcon from '@mui/icons-material/Mail';
import PhoneInTalkIcon from '@mui/icons-material/PhoneInTalk';

function Contact() {

    return (
        <>
            <div className="ContactFrames" style={{ display: "grid", gridTemplateColumns: "1fr 1fr ", height: "100vh" }}>
                <div style={{ background: 'linear-gradient(to right,#124076,#E5DDC5)' }} >
                    <div style={{display:"flex",flexDirection:"column"}}>
                    <FacebookIcon style={{ color: "#fff" ,fontSize: 40}} />
                    <InstagramIcon style={{color:"#fff",fontSize:40}}/>
                    <MailIcon style={{color:"#fff",fontSize:40}}/>
                    <PhoneInTalkIcon style={{color:"#fff",fontSize:40}}/>

                    </div>
                </div>

                <div style={{ background: 'linear-gradient(to left,#003C43,#E5DDC5)' }}>

                </div>

            </div>
        </>
    );
}
export default Contact;
